import React, {useState} from 'react';
import ReactDOM from 'react-dom';


function App() {
	const [name , setName] = useState('');
	const [age , setAge] = useState('');
	const [email , setEmail] = useState('');
	const [password , setPassword] = useState('');
	const [confPassword , setConfPassword] = useState('');


	const handleAgeChange =(e)=>{
	setAge(e.target.value);
	}
	const handleEmailChange =(e)=>{
	setEmail(e.target.value);
	}
	const handlePasswordChange =(e)=>{
	setPassword(e.target.value);
	}
	const handleConfPasswordChange =(e)=>{
	setConfPassword(e.target.value);
	}
	const handleSubmit=(e)=>{
	if(password!=confPassword)
	{
		alert("password Not Match");
	}
	else{
		alert('A form was submitted with Name :"' + name +
		'" ,Age :"'+age +'" and Email :"' + email + '"');
	}
	e.preventDefault();

	}
return (
	<div className="App">
	<header className="App-header">
	<form onSubmit={(e) => {handleSubmit(e)}}>
	<div style={{display:'flex',flexDirection:'row'}}>
        <img  width="100"  src="data:image/png;base64," />
	    <h2 >KEY-EDUCATION FOUNDATION</h2>
    </div>
	<h3> Sign-Up</h3>
    <div style={{display:'flex',flexDirection:'row' ,padding:'15px',justifyContent:'space-around'}}>
	    <label >Name:</label>
		<input type="text" value={name} required onChange={(e)=>{setName(e.target.value)}} /><br/>
    </div>
    <div style={{display:'flex',flexDirection:'row' ,padding:'15px'}}>
		<label>Email:</label>
		<input type="email" value={email} required onChange={(e)=> {handleEmailChange(e)}} /><br/>
    </div>
    <div style={{display:'flex',flexDirection:'row' ,padding:'15px'}}>
		<label>Password:</label>
		<input type="password" value={password} required onChange={(e)=> {handlePasswordChange(e)}} /><br/>
			
    </div>
    <div style={{display:'flex',flexDirection:'row' ,padding:'15px'}}>
        <label>Confirm Password:</label>
		<input type="password" value={confPassword} required onChange={(e)=> {handleConfPasswordChange(e)}} /><br/>
        </div>
	<input type="submit" value="Submit"/>

   
	</form>
	</header>
	</div>
);
}

export default App;
